import React from 'react';
import * as api from './services/api';

class ListOfCategories extends React.Component {
  render() {
    return (
      <div>
        { api.getCategories().then((categories) => categories.map(cat => { <p>{cat.name}</p> })) }
      </div>
    );
  }
}

export default ListOfCategories;
